using System.Numerics;
using Nethereum.ABI.FunctionEncoding.Attributes;
using Nethereum.Contracts;

namespace Infura.SDK.Common.Contracts.Templates.ERC721
{
    public class ERC721UserMintableDeploymentBase : ContractDeploymentMessage
    {
        public static string BYTECODE = "";
        public ERC721UserMintableDeploymentBase() : base(BYTECODE) { }
        public ERC721UserMintableDeploymentBase(string byteCode) : base(byteCode) { }
        [Parameter("string", "name_", 1)]
        public virtual string Name { get; set; }
        [Parameter("string", "symbol_", 2)]
        public virtual string Symbol { get; set; }
        [Parameter("string", "baseURI_", 3)]
        public virtual string Baseuri { get; set; }
        [Parameter("string", "contractURI_", 4)]
        public virtual string Contracturi { get; set; }
        [Parameter("uint256", "maxSupply_", 5)]
        public virtual BigInteger Maxsupply { get; set; }
        [Parameter("uint256", "price_", 6)]
        public virtual BigInteger Price { get; set; }
        [Parameter("uint8", "maxTokenRequest_", 7)]
        public virtual byte Maxtokenrequest { get; set; }
    }
}